description:
Role: Data Analyst Permanent, Direct Hire Remote, Team works EST Less than 5% travel to onsite location Salary $80-90K plus benefits **Our client is unable to offer sponsorship for this role. We are unable to work C2C on this role. ** Responsibilities: * Proficiency in assessing and solving complex technical issues * Solid analytical and communication skills * Creates proper communication... process, and educational plans to identify and remove barriers * Functions as the subject matter expert in assisting decision making, strategy, performance improvement, and objectives through reports, dashboards, and other analytic tools.
• Takes a lead role in projects;
Contributes to meetings and provides feedback to improve results. * Mentors and shares knowledge with team. * Maintains high professional standards. * Completes analysis using statistical analysis, explanatory and predictive modeling, data mining. * Defines best practices and cultivates proposals for business operations.
• Collaborates with clients to identify analytical requirements. * May assist with ad hoc projects as needed;
implementing or developing systems Requirements: * Bachelor's degree * 3-5+ years of data analysis experience * Comfortable working in clinical/project-based environment. * Experience mining data using SQL queries * Data visualization experience: Power BI or Tableau * Preferred: Python or Pandas programming knowledge * Preferred: Epic Certification * Preferred: CAPM or PMP certification

Expert Data Analysts needed to work 3-6 hours, 3-5 days a week (as needed) between the night hours of 8 PM EST - 7 AM EST.

This will initially be a 1-month engagement and will extend to a 1-year contract (minimum) if the quality of work is deemed high quality...

1. Convert business reports from Excel to PowerBI and Tableau dashboards;

2. Comb through data and analyze heavily to expose relevant and timely insights - provide insights and recommendations regarding business data;

3. Analyze customer data trends to create and communicate actionable insights that help drive decision-making;

4. Furnish analysis with insight while maintaining completeness, accuracy, and documentation. Identify, analyze, and interpret trends or patterns in complex data sets;

4. Heavy SQL - Build reports and optimize SQL data pipelines in BigQuery and Microsoft SQL Server using methods such as CTEs, recursion, Window functions, PDTs, stored procedures, etc.)

5. The ability to synthesize complex data and hypotheses into a digestible format for both technical & non-technical audiences
